



use super::*;

pub fn pass(cbi: &mut CallbackInterface) -> Result<()> {
    cbi.protocol = Protocol {
        
        
        name: cbi.name.clone(),
        base_classes: vec!["typing.Protocol".to_string()],
        methods: cbi.methods.clone(),
        docstring: cbi.docstring.clone(),
    };
    cbi.name = format!("{}Impl", cbi.name);
    Ok(())
}
